INSERT INTO `aktorzy` (`IDaktora`, `imie`, `nazwisko`, `data_urodzenia`, `biografia`, `zdjecie`) VALUES
(1, 'Aurelio', 'Voltaire', '1967-01-25', 'Voltaire (dokładnie Aurelio Voltaire Hernández) urodził się 25 stycznia 1967 na Hawanie na Kubie. Jest jednym z najpopularniejszych muzyków na scenie muzyki goth.\r\nVoltaire jest również doświadczonym twórcą animacji i komiksów, oraz jest profesorem w School of Visual Arts w Nowym Jorku.', );
INSERT INTO `aktorzy` (`IDaktora`, `imie`, `nazwisko`, `data_urodzenia`, `biografia`, `zdjecie`) VALUES
(2, 'Adam', 'Sandler', '1966-09-09', 'Adam Sandler urodził się 9 września 1966 r. w Nowym Jorku. Jest czwartym dzieckiem amerykańskich Żydów Stana i Judy Sandler. Jego starsze rodzeństwo to Scott, Liz i Val. Sandler rozpoczął występy komika w bostońskim klubie komediowym. Odkrył go tam Dennis Miller, dzięki czemu Adam trafił do \"Saturday Night Live\" jako autor scenariusza. Rok później występował już jako aktor. Grając tam zdobył dużą popularność, a show opuścił w roku 1995, aby skupić się na karierze aktorskiej. W tym samym roku zagrał tytułową rolę w filmie \"Billy Madison\". W 1998 r. zdobył tytuł magistra sztuk pięknych na Uniwersytecie Nowojorskim.Wielką popularność przyniosła mu rola Robbiego Harta w filmie \"Od wesela do wesela\". Sandler zazwyczaj obsadzany zostaje w rolach pierwszoplanowych, np. w \"Super tacie\" jako Sonny Koufax, w \"Małym Nickim\" jako Nicky lub jako Michael Newman w \"Klik: I robisz, co chcesz\" . Prywatnie jest żonaty z modelką Jackie Titone, mają dwójkę dzieci Sadie Madison i Sunny Madeline.', );
INSERT INTO `aktorzy` (`IDaktora`, `imie`, `nazwisko`, `data_urodzenia`, `biografia`, `zdjecie`) VALUES
(3, 'Sacha', 'Cohen', '1971-11-13', 'Urodził się w dzielnicy Hammersmith w Londynie. Jest drugim synem pochodzącego z Walii Geralda Baron Cohena i Izraelitki Danielli Weiser. Uczęszczał do prywatnej szkoły Haberdasher\'s Aske\'s Boy\'s School w Elstree. Następnie rozpoczął studia na wydziale historii Christ\'s College w ramach Uniwersytetu Cambridge, które ukończył w 1993 roku. Podczas studiów występował na deskach teatru Footlight należącego do Uniwersytetu Cambridge. Sławę zyskał w 1998 roku, gdy jego postać, Ali G, zaczęła pojawiać się w programie The Eleven O\'Clock Show. W 2000 roku powstało Da Ali G Show i zdobyło nagrodę BAFTA za \"najlepszą serię komediową\" w roku następnym. Dwa lata później powstał pełnometrażowy film \"Ali G Indahouse\", w którym Ali G był główną postacią. W 2006 roku Baron Cohen\r\nwcielił się w postać Borata w filmie \"Borat: Podpatrzone w Ameryce, aby Kazachstan rósł w siłę, a ludzie żyli dostatniej\", który w wielu krajach został okrzyknięty \"komedią roku\". Tytułowa rola w tym filmie przyniosła mu nagrodę Złotego Globu w 2007 roku.', );
INSERT INTO `aktorzy` (`IDaktora`, `imie`, `nazwisko`, `data_urodzenia`, `biografia`, `zdjecie`) VALUES
(4, 'Taron ', 'Egerton', '1989-11-10', 'Taron David Egerton urodził się w brytyjskim mieście portowym Birkenhead, ale większość swojego życia spędził w Walii, stąd mówi płynnie po walijsku. W 2012 zdobył dyplom na Królewskiej Akademii Sztuki Dramatycznej w Londynie (The Royal Academy of Dramatic Art). Debiutancką rolę zagrał w 2011 roku w serialu telewizyjnym pt. \"Lewis\" – pojawił się w nim gościnnie w dwóch odcinkach. Następnie dostał angaż do jednej z głównych ról w serialu \"The Smoke\". Drogę do światowej kariery otworzył mu występ w filmie Matthew Vaughna pt. \"Kingsman: Tajne służby\". \r\nOprócz aktorstwa Egerton szkoli się też w tańcu i śpiewie. ', );
INSERT INTO `aktorzy` (`IDaktora`, `imie`, `nazwisko`, `data_urodzenia`, `biografia`, `zdjecie`) VALUES
(6, 'Bill ', 'Skarsgård', '1990-08-09', 'Bill pochodzi z jednej z najbardziej znanych europejskich rodzin aktorskich. Jego ojcem jest Stellan Skarsgård, aktor i reżyser znany, między innymi, z filmów z serii Piraci z Karaibów, Mamma Mia! i filmów Larsa von Triera. Braćmi aktora są natomiast Alexander, Gustaf i Valter, którzy również są aktorami.', );
INSERT INTO `aktorzy` (`IDaktora`, `imie`, `nazwisko`, `data_urodzenia`, `biografia`, `zdjecie`) VALUES
(7, 'Keanu', 'Reeves', '1964-09-02', 'Mówi o sobie, że jest zwykłym chłopakiem bez ojca, który ma energiczną matkę i dwie piękne siostry. Nie wspomina o popularności, jaką zyskał dzięki swemu aktorskiemu dorobkowi w latach 80. i 90. Nie lubi reporterów ani publicznych wypowiedzi. Na pytania często odpowiada lakonicznym stwierdzeniem: \"ja nic nie wiem\" lub, gdy zostanie przyłapany na jakiejś sprzeczności, odpowiada \"może po prostu nie wiem, co mówię\".\r\n\r\nKeanu urodził się 2 września 1964 roku w Bejrucie. Jego drzewo genealogiczne sięga nie tylko różnych państw, ale i kontynentów.\r\nOrientalne rysy zawdzięcza ojcu, Samuelowi Nowlinowi Reevesowi, który jest pół Hawajczykiem i pół Chińczykiem. On też nadał mu oryginalne imię Keanu, co w języku polinezyjskim oznacza \"chłodny wiatr wiejący z gór\". Matka, Patricia Taylor, jest Angielką, znaną projektantką kostiumów teatralnych. Keanu nie miał łatwego dzieciństwa. Gdy miał dwa lata, rodzice przenieśli się na rok do Australii, gdzie urodziła się pierwsza siostra Keanu - Kim. Po rozwodzie rodziców zamieszkał z matką w Nowym Jorku, która poznała reżysera Paula Aarona i ponownie wyszła za mąż. Ojciec zamieszkał na Hawajach. Po rozstaniu z Paulem matka przeniosła się z dziećmi do Toronto, przyjmując również obywatelstwo kanadyjskie, które Keanu zachował do dzisiaj. Patricia jeszcze kilka razy wychodziła za mąż. Każdy ślub łączył się ze zmianą miejsca zamieszkania. Jednym z ojczymów Keanu był promotor rockowy Robert Miller. Z tego małżeństwa urodziła się druga siostra Keanu, Karina.\r\n\r\nCzęsta zmiana miejsca zamieszkania nie sprzyjała edukacji Keanu. Do ukończenia ósmej klasy uczył się w Jesse Ketchum Public School w Toronto i to był najdłuższy okres nauki w jednej szkole. Potem uczęszczał do czterech szkół średnich, w tym do szkoły aktorskiej w Toronto. Wkrótce jednak został z niej wydalony za brak postępów w nauce. Nauczyciele wspominają, że Keanu nie radził sobie z nauką, często zostawiał książki w domu lub zapominał pracy domowej.\r\n\r\nPostanowił więc podjąć pracę. Ostrzył łyżwy na lodowisku, robił ciasto do pizzy, jako entuzjasta hokeja na lodzie był także jego instruktorem. W wolnych chwilach kręcił się po wytwórniach telewizyjnych i filmowych. Zauważył go kanadyjski reżyser i dał mu małą rolę w cieszącym się popularnością serialu \"Hanging In\".\r\n\r\nPierwszy prawdziwy debiut aktorski, jeszcze wciąż bardzo skromny, to niewielka rola w filmie \"Wzlot\". Ta rola pozwoliła mu na podróż do Hollywood. Całym jego kapitałem było zdezelowane auto, 3 tys. dolarów i adres byłego ojczyma, reżysera Paula Aarona, w notesie. Ale szczęście mu dopisało. Aaron pomógł mu poznać kilku odpowiednich ludzi, co zaowocowało rolą w filmie \"Youngblood\". Dzięki swej chłopięcej urodzie dwa lata po amerykańskim debiucie kinowym Keanu zagrał w filmie \"Niebezpieczne związki\", u boku takich sław jak Michelle Pfeiffer czy John Malkovich. Wcielił się w nim w postać romantycznego kochanka, wrażliwego kawalera Danceny.\r\n\r\nLawina propozycji rusza...\r\n\r\nW 1991 roku zagrał z Patrickiem Swayze w filmie \"Na fali\", rok później z Winoną Ryder w filmie Francisa Forda Coppoli \"Dracula\"; potem w adaptacji szekspirowskiej sztuki \"Wiele hałasu o nic\". Kontynuacją sukcesu była kreacja w filmie Bernardo Bertolucciego \"Mały Budda\", gdzie wcielił się w postać księcia Siddaharty.\r\n\r\nPopularność wzrasta...\r\n\r\nW 1994 roku zagrał w najbardziej kasowym filmie w jego karierze \"Speedzie - Niebezpiecznej prędkości\", który przyniósł mu światową sławę, niezależność i olbrzymie pieniądze.\r\n\r\nW kolejnych filmach zmieniał aktorski wizerunek, przestał grać kochanków i herosów. W thrillerze \"Johnny Mnemonic\" zagrał kuriera z przyszłości, który dzięki elektronicznemu wszczepowi może przenosić informacje ratujące ludzkość. W pełni sławy postanowił wrócić do Kanady i spełnić swoje marzenie zagrania w \"Hamlecie\" na scenie teatralnej. Oceny był różne, przeważały jednak pozytywne i ciepłe. Mimo to szybko wrócił do filmu, wcielając się m.in. w chłopaka uciekającego z żoną brata w \"Feeling Minnesota\", a w \"Reakcji łańcuchowej\" - w inżyniera, który ucieka z FBI. Wystąpił jeszcze w paru filmach, po czym zaproponowano mu rolę w drugiej części \"Speed\". Odrzucił tę propozycję, gdyż, jak twierdził, scenariusz pozostawiał wiele do życzenia. Najbliżsi namawiali go do zmiany decyzji, jednak on pozostał przy swoim. \"Speed 2\" okazał się niewypałem, a Keanu w tym czasie wystąpił w \"Adwokacie diabła\", który stał się przebojem i przyniósł ogromne zyski. Dziennikarze zaczęli rozpisywać się o wielkim wyczuciu Keanu w kwestii odrzucenia scenariusza \"Speed 2\" i przyjęcia roli w \"Adwokacie diabła\" i roli u boku Ala Pacino.\r\n\r\nNa uwagę zasługuje kreacja Keanu w filmie \"Moje własne Idaho\". Zagrał w nim homoseksualistę, który na złość bogatemu ojcu uprawia prostytucję. Zagrał tak przekonująco, że brukowe gazety rozpisały się o jego odmiennej orientacji seksualnej. Na planie filmu zaprzyjaźnił się z partnerującym mu Riverem Phoenixem. Po jego nagłej śmierci na skutek przedawkowania narkotyków Keanu przeżył dramat - tym większy, że prasa właśnie jego obwiniała o tę śmierć. Po tym wydarzeniu przez długi czas był pod opieką psychoterapeuty.\r\n\r\nNajgłośniejszym filmem Keanu jest thriller science fiction \"Matrix\", którego akcja częściowo rozgrywa się w rzeczywistości wirtualnej. Zdjęcia kręcono w Australii. Była to duża niewiadoma. Nikt nie był pewny sukcesu i przyjęcia filmu przez widzów. Okazało się, że niesłusznie - film przyniósł sukces reżyserom, a samego Keanu wyniósł na szczyty sławy. Stał się jednym z najlepiej zarabiających aktorów - za \"Matrix\" dostał 10 mln dolarów.\r\n\r\nKeanu Reeves to nie tylko aktor. Jego pasją jest gra na gitarze basowej. Jest członkiem popularnego w USA zespołu Dogstar. Często wyjeżdża w trasy koncertowe, nagrywa płyty. Przez wiele lat był dumny z tego, że nie miał stałego miejsca zamieszkania, że był człowiekiem \"w drodze\". Przyznaje, że lubi mieszkać w hotelach, gdyż nie znosi sprzątania. Ostatnio kupił jednak posiadłość w Los Angeles: dom ma pięć łazienek, wielki pokój telewizyjny i saunę. Przed domem zasadził drzewa oliwkowe, sprowadzone specjalnie z Hiszpanii.\r\n\r\nJeszcze kilka lat temu Keanu był dla nastolatek tym, kim jest dla nich obecnie Leonardo DiCaprio. Wierne fanki zmartwi pewnie to, że Keanu nie wygląda teraz najlepiej. Schudł ponad 20 kg i obciął włosy. Podobno cierpi na anoreksję, brukowe gazety rozpisują się na temat AIDS...', );
INSERT INTO `aktorzy` (`IDaktora`, `imie`, `nazwisko`, `data_urodzenia`, `biografia`, `zdjecie`) VALUES
(8, 'Travis ', 'Fimmel', '1979-07-15', 'Syn Chrisa Fimmela - hodowcy bydła i pielęgniarki Jennie pochodzi z Australii. Urodził się 15 lipca 1979 roku 40 mil od miejscowości Echuca, w północnej części stanu Victoria. Po ukończeniu 17 lat przeniósł się do Melbourne, gdzie uczęszczał na Uniwersytet RMIT. Grał tam w piłkę nożną i później studiował projektowanie. Po złamaniu nogi zrezygnował z profesjonalnej piłkarskiej kariery. Wysoki (183 cm wzrostu) niebiesko-zielonooki blondyn wkrótce potem został odkryty przez łowcę talentów Matthew Andersona i podjął pracę dla Chadwick Model Management.\r\n\r\nZanim osedlił się w Londynie, gdzie pracował w pubie, przez dwa i pół roku podróżował po Europie, Tajlandii i Azji. W roku 2000 postanowił wyjechać do Stanów Zjednoczonych, zamieszkał w Los Angeles i rozpoczął karierę z 60 dolarami w kieszeni. Pracował dla agencji LA Models, gdzie jego agentem był Paul Nelson. Wystąpił w kampanii reklamowej \'\'Gap\'\' i \'\'L\'Oreal\'\'. Pojawił się w teledysku Janet Jackson (\"Someone To Call My Lover\", 2001 r.) i Jennifer Lopez (\"I\'m Real\", 2003 r.). Reklamował wyroby Calvina Kleina.\r\n\r\nJego zdjęcie w stringach Calvina Kleina na billboardzie spowodowało takie zamieszanie na zajętych ulicach Londynu, że klub samochodowy zażądał jego usunięcia, bo kobiety-kierowcy zwalniały przy billboardzie, powodując wypadki i korki. W 2002 roku Travis był nominowany do tytułu najseksowniejszego kawalera świata magazynu \"People\".\r\n\r\nZadebiutował w roli Johna Claytona, tytułowego bohatera kanadyjsko-amerykańskiego serialu Warner Bros \"Tarzan\". To nowe przygody Tarzana od afrykańskiej dżungli do ulic Nowego Jorku.\r\n\r\nBył związany z Nicole Appleton, wokalistką zespołu All Saints.', );
INSERT INTO `aktorzy` (`IDaktora`, `imie`, `nazwisko`, `data_urodzenia`, `biografia`, `zdjecie`) VALUES
(9, 'Michael', 'Duncan', '1957-12-10', 'Aktor ten w Hollywood nazywany jest Big Mike (Wielki Mike), a wynika to z jego wzrostu (prawie dwa metry) oraz wagi (ponad 135 kg). Mówią o nim jako o olbrzymie z wielkim sercem i ujmującą osobowością. Za młodu trenował kulturystykę oraz pracował jako bramkarz. Rozgłos zyskał dzięki roli jednego z grupy wiertniczych ratujących Ziemię przed zderzeniem z potężną asteroidą w filmie \"Armageddon\".\r\nUrodził się jak również dorastał w Chicago i był wychowywany tylko przez matkę. W stronę aktorstwa zwrócił się w szkole średniej, po tym jak jego matka, z obawy o zdrowie syna, zabroniła mu grać w drużynie footballowej Chicago Bears. Po skończeniu szkoły średniej kontynuował naukę na stanowym uniwersytecie Mississippi\'s Alcorn, gdzie studiował na wydziale komunikacji. Niestety choroba matki zmusiła go do przerwania studiów i powrotu do Chicago. Musiał utrzymywać rodzinę, więc zaczął pracować. W dzień kopał rowy, a w nocy pracował jako bramkarz w nocnych klubach. W jednym z klubów poznał producenta teatralnego, który zaangażował go do ochraniania jego zespołu. Razem z nim Duncan w połowie lat 90. dotarł do Hollywood.\r\nPoczątki w Los Angeles były bardzo ciężkie dla Michaela. Znalazł się w bardzo trudnej sytuacji finansowej. Zatrudnił się w agencji ochroniarskiej (pracował m.in. dla Willa Smitha i Martina Lawrence\'a) i jednocześnie rozglądał się za rolami filmowymi. Znalazł sobie także pierwszego agenta. Swoją karierę aktorską rozpoczął od reklam telewizyjnych, sitcomów i opery mydlanej \"The Bold and the Beautiful\". Na dużym ekranie zadebiutował w rolach bramkarzy w \"The Players Club\" i \"Senator Bulworth\". W końcu otrzymał pierwszą rolę, która nie wymagała wyrzucania ludzi z klubów, w filmie \"Armageddon\". Film ten odniósł ogromny sukces komercyjny i stał się przełomem w karierze aktora. Na planie filmu zaprzyjaźnił się z Brucem Willisem, który pomógł mu zdobyć rolę w \"Zielonej mili\", historii o Johnie Coffeyu - dobrodusznym olbrzymie posiadającym zdolności paranormalne, niewinnie skazanym na karę śmierci i oczekującym na wykonanie wyroku. Duncan znakomicie odtworzył postać Coffeya, co doceniła również krytyka przyznając mu statuetkę Złotego Globu oraz nominując go do Oscara. Rok po sukcesie \"Zielonej mili\" Duncan ponownie zagrał obok Bruce\'a Willisa w komedii \"Jak ugryźć 10 milionów\". W 2001 roku wystąpił w wysokobudżetowej \"Planecie małp\", a w 2002 roku zagrał Balthazara w filmie \"Król skorpion\". Niejednokrotnie Duncan użyczał swojego głosu, m.in. filmie \"Psy i koty\" oraz w aminowanej serii \"Spider-Man\" (2003).', );
INSERT INTO `aktorzy` (`IDaktora`, `imie`, `nazwisko`, `data_urodzenia`, `biografia`, `zdjecie`) VALUES
(10, 'Harrison', 'Ford', '1942-07-13', 'Harrison Ford jest jednym z najpopularniejszych gwiazdorów światowego kina. Dorastał na przedmieściach Chicago. Dla aktorstwa zrezygnował z nauki w Ripon College. Zadebiutował w filmie \"Spryciarz Ed\". Po pierwszych niepowodzeniach zawodowych zajął się stolarstwem, które do dziś stanowi jego hobby. W latach 70. grywał niewielkie role u takich reżyserów jak Michelangelo Antonioni, George Lucas czy Francis Ford Coppola.\r\n\r\nRok 1977 oznaczał przełom w jego karierze. Zagrał wtedy u Lucasa w \"Gwiezdnych wojnach\". Wystąpił też w dalszych częściach futurystycznej epopei - \"Imperium kontratakuje\" i \"Powrót Jedi\". Niebywałą popularność przyniosła mu także kreacja Indiany Jonesa w kolejnych odcinkach przygód tytułowego bohatera. W 1984 roku zagrał w kultowym dziś filmie Ridleya Scotta \"Łowca androidów\". Znacząca była też rola w \"Świadku\" Petera Weira, za którą otrzymał nominację do Oscara.\r\n\r\nW dorobku artystycznym Forda znajdują się zarówno ambitne kreacje dramatyczne, jak też role amantów i twardych, silnych facetów. Lata dziewięćdziesiąte oznaczały dla niego głównie występy w thrillerach i filmach akcji, jak na przykład \"Ścigany\" czy \"Czas patriotów\". W 2000 roku Amerykański Instytut Filmowy nagrodził go za całokształt twórczości.\r\nHarrison Ford urodził się 13 lipca 1942 roku. Kształcił się w Wisconsin, po czym przeniósł do Los Angeles, gdzie rozpoczął karierę aktorską. Początkowo był kontraktowym aktorem wytwórni Columbia Pictures i zadebiutował w filmie \"Spryciarz Ed\".\r\n\r\nPo niewielkiej roli w \"Uciekającym punkcie\" zdecydował, że sprawy finansowe nie będą miały wpływu na jego karierę aktorską. Zaczął więc zarabiać jako stolarz. Po trzyletniej przerwie przyjął rolę w \"Amerykańskim graffiti\" w reżyserii George\'a Lucasa, który to film odniósł oszałamiający sukces kasowy. Po kolejnej przerwie George Lucas obsadził go jako Hana Solo w epizodach IV, V i VI \"Gwiezdnych wojen\".\r\n\r\nPo tej roli nastąpił przełom w jego karierze aktorskiej. Wielki sukces kasowy odniosła również seria filmów o przygodach Indiany Jonesa, w której Harrison Ford grał główną rolę. Inne filmy, w których zagrał, to \"Świadek\",\"Czas Apokalipsy\", \"Wybrzeże Moskitów\", \"E.T.\". Od wielu lat uważany jest za jednego z najlepszych aktorów na świecie.', );

