INSERT INTO `nagrody` (`IDnagrody`, `nazwa`, `opis_nagrody`, `zdjecie`) VALUES
(1, 'Oscar', 'Nagrody Akademii Filmowej, znane powszechnie pod nazwą Oscary, zostały stworzone w 1927 roku (pierwsze przyznanie nagród, za rok 1927 i 1928, nastąpiło 16 maja 1929 roku). Od lat są uznawane za najbardziej prestiżową nagrodę filmową.\r\n\r\nPierwsze Oscary zostały przyznane w 13 kategoriach. Dziś jest ich 24, między innymi: najlepszy film, reżyseria, aktor, aktorka, zdjęcia, muzyka, scenariusz oryginalny i scenariusz adaptowany. Od 2002 roku ceremonia rozdania nagród odbywa się w hollywoodzkim Kodak Theatre. Początkowo wręczenie nagród Akademii odbywało się na przełomie marca i kwietnia. W 2004 roku galę przesunięto na ostatni tydzień lutego.\r\n\r\nLaureatów Oscarów wybierają członkowie Amerykańskiej Akademii Filmowej zrzeszającej amerykańskich filmowców różnych profesji (obecnie udział w głosowaniu bierze ok. 6000 osób). Nominacje mogą otrzymać filmy, które w poprzedzającym rozdanie nagród roku kalendarzowym były wyświetlane w jednym z kin Los Angeles.\r\n\r\nStatuetka, o której marzą filmowcy na całym świecie, jest wykonana z brązu i pokryta warstwą 24-karatowego złota. Przedstawia nagiego rycerza trzymającego miecz i stojącego na cokole zwieńczonym rolką taśmy filmowej z pięcioma klatkami. Klatki symbolizują pierwotne branże Akademii: Aktorów, Scenarzystów, Reżyserów, Producentów i Techników.\r\n\r\nAkademicy wielokrotnie byli narażeni na krytykę: zlekceważyli niejeden wybitny film przyznając w zamian nagrodę takiemu, o którym dziś pamiętają jedynie historycy filmu. Mimo tego żadna inna nagroda nie wzbudza tak wielkiego zainteresowania branży filmowej i publiczności na całym świecie.', );
INSERT INTO `nagrody` (`IDnagrody`, `nazwa`, `opis_nagrody`, `zdjecie`) VALUES
(2, 'Złoty Glob', 'Złoty Glob (ang. Golden Globe Awards) – nagroda filmowa przyznawana corocznie przez Hollywoodzkie Stowarzyszenie Prasy Zagranicznej, HSPZ (Hollywood Foreign Press Association, HFPA) w dziedzinie filmu i telewizji. Punktem kulminacyjnym uroczystej kolacji jest ceremonia rozdania nagród za filmy i seriale, których premiera nastąpiła w roku kalendarzowym poprzedzającym przyznanie nagrody.', );
INSERT INTO `nagrody` (`IDnagrody`, `nazwa`, `opis_nagrody`, `zdjecie`) VALUES
(3, 'Złota Malina', 'Złota Malina (ang. Golden Raspberry Award, skr. Razzie) – antynagroda przyznawana najgorszym filmom, wymyślona przez krytyka filmowego Johna J. B. Wilsona w 1980. Pierwsza ceremonia odbyła się 31 marca 1981. Aktualnie nagrody te przyznaje GRAF (Golden Raspberry Award Foundation).\r\n\r\nStatuetka Złotej Maliny jest wykonywana z tworzywa sztucznego przemalowanego na kolor złoty. Ma formę sztucznego owocu maliny umiejscowionego na rolce filmu Super 8. Wartość nagrody wynosi w przybliżeniu 4,89 dolara.\r\n\r\nJedynym nagrodzonym polskim filmem jest 365 dni, który w 2021 otrzymał nagrodę w kategorii Najgorszy scenariusz. Łącznie uzyskał nominacje w sześciu kategoriach.', );

