--

INSERT INTO `rezyserzy` (`IDrezysera`, `imie`, `nazwisko`, `data_urodzenia`, `biografia`, `zdjecie`) VALUES
(1, 'Steven', 'Spielberg', '1946-12-18', 'Jest uważany za najwybitniejszego reżysera naszych czasów. Na swoim koncie ma wiele ważnych dla światowej kinematografii filmów. Jest człowiekiem, o którym ludzie piszą książki i rozprawy naukowe. Spielberg nie uczył się reżyserii w żadnej ze szkół, jest samoukiem.\r\n\r\nSwój pierwszy film zrobił w wieku 16 lat. Nosił on tytuł \"Firelight\" i był przez jeden wieczór wyświetlany w kinie w rodzinnym mieście twórcy. Następny film \"Amblin\" zwrócił na Spielberga uwagę ludzi z Universal Studio, którzy zaproponowali mu pracę reżysera obrazów telewizyjnych. Po zrobieniu kilku odcinków znanych seriali m.in. \"Columbo\", Steven stworzył film, który dziś uznawany jest za jego debiut - \"Pojedynek na szosie\". Został on bardzo ciepło przyjęty zarówno przez krytyków, jak i widzów i pokazał producentom, że mają do czynienia z twórcą ponadprzeciętnym. Kolejne filmy Spielberga to pasmo sukcesów: \"Szczęki\", \"Bliskie spotkania trzeciego stopnia\", \"E.T\", żeby wymienić tylko kilka z nich.\r\n\r\nReżyser udowodnił, że na ekranie można pokazać wszystko. Publiczność na całym świecie zachwycała się filmami, które przedstawiały ich marzenia, opowiadały o przygodach i kosmitach. Dostarczały niesamowitych wrażeń wizualnych, ale i przeżyć natury duchowej. Nietrudno więc zrozumieć, że kiedy w 1985 roku Spielberg zrobił \"Kolor purpury\", krytyka przyjęła film z niejakim zaskoczeniem. Nikt po nim, człowieku, który oficjalnie przyznawał się, że jeszcze nie wydoroślał, nie spodziewał się dramatu. Od tamtego czasu Steven stara się robić różne filmy. Co jakiś czas wraca do swoich dziecięcych marzeń i tworzy nowy, fantastyczny, ale jednocześnie przekonujący świat, jak np. w \"Parku Jurajskim\", a czasami cofa się do przeszłości i przypomina niezbyt chwalebne wydarzenia z naszej historii, zmuszając do refleksji: \"Lista Schindlera\", \"Amistad\".\r\n\r\nSpielberg jest właścicielem Amblin Entertainment, firmy odpowiedzialnej za produkcję takich hitów jak: \"Powrót do przyszłości\", czy \"Kto wrobił królika Rogera\". Jest również twórcą i pomysłodawcą wielu seriali telewizyjnych: \"Strefa mroku\", \"Niesamowite historie\". W 1990 roku stworzył postaci \"animków\", bohaterów serii \"Tiny Toon\", która stała się jedną z najbardziej lubianych przez dzieci na całym świecie. W 1994 roku wspólnie z Davidem Geffenem i Jeffreyem Katzenbergem założył Dreamworks, firmę zajmującą się produkcją filmów i programów multimedialnych. Do ich największych osiągnięć należy zaliczyć obraz \"Książę Egiptu\", animowaną opowieść opowiadającą o życiu Mojżesza i grę komputerową \"The Neverhood\", w której wykorzystano nowatorskie metody tworzenia grafiki komputerowej.', ),
(2, 'Dennis', 'Dugan', '1946-09-05', 'Dugan rozpoczął aktorską karierę na początku lat 70. Przez kolejne 20 lat wystąpił w kilkunastu filmach. Najbardziej znaczące kreacje stworzył m.in. w komediach Harry i Walter jadą do Nowego Jorku (1976; reż. Mark Rydell) i Spokojnie, tatuśku (1989; reż. Ron Howard); a także horrorze Joego Dante Skowyt (1981). W 1990 zadebiutował jako reżyser komedią Kochany urwis. Od tego czasu wyreżyserował kilkanaście filmów, stając się specjalistą od niezbyt ambitnych, ale cieszących się sporą popularnością komedii. W 1996 roku, filmem Farciarz Gilmore rozpoczął współpracę z komikiem Adamem Sandlerem, który regularnie występuje w jego komediach. Poświęcając się reżyserii Dugan nie do końca porzucił aktorstwo, często pojawia się w niewielkich rolach w swych filmach. Choć reżyserska kariera przyniosła mu największy sukces, to jednakże za dwie ze swoich komedii otrzymał nominację do niechlubnej nagrody Złotej Maliny dla najgorszego reżysera za filmy Super tata (1999) oraz Państwo młodzi: Chuck i Larry (2007).', );

